import React from "react";
import "./Logo.css";

const img = require("./you(white).jpg");

class Logo extends React.Component {
    render() {
        return (
            <div id="" className="fl w-30">
                {/* Logo needs to return to homepage */}
                <a href="#">
                <img id="logo" className="grow" src={img} alt="You.AI"/>
                &#9673;AI
                </a>
            </div>
        )
    }
}

export default Logo;
